import Header from "../components/Header";
import { createGlobalStyle } from "styled-components";

const GlobalStyle = createGlobalStyle`
  body {
    color: ${(props) => (props.whiteColor ? "white" : "red")};
  }
`;

const Index = () => (
  <>
    <GlobalStyle>
      <Header />
      <div>Hello Next</div>
    </GlobalStyle>
  </>
);

export default Index;
